    private val jweBackupFactory = BackupParser()
    private val microsoft2020BackupProcessor = Microsoft2020BackupProcessor(
        identifierService,
        identifierRepository,
        keyStore,
        RawIdentifierConverter(identifierRepository, keyStore),
        defaultTestSerializer
    )
    private val backupProcessorFactory = BackupProcessorFactory(microsoft2020BackupProcessor)

    private val service = BackupService(jweBackupFactory, backupProcessorFactory, identifierRepository, defaultTestSerializer)
    private val password = "Big complex passsword you'll never be able to guess"

    private val vcMetadata = TestVcMetaData(BackupTestUtil.testDisplayContract)

    private val backup = Microsoft2020UnprotectedBackup(
        WalletMetadata(),
        listOf(Pair(BackupTestUtil.testVerifiedCredential, vcMetadata))
    )

    @Test
    fun `export and import returns protectedBackupData`() {
        coEvery { identifierService.getMasterIdentifier() } returns Result.Success(masterIdentifier)
        runBlocking {
            val protectionMethod = JwePasswordProtectionMethod(password)
            val protectedBackupData = (service.exportBackup(backup, protectionMethod) as Result.Success).payload
            assertThat(protectedBackupData).isInstanceOf(JwePasswordProtectedBackupData::class.java)

            val result = service.importBackup(protectedBackupData, protectionMethod)
            val actualBackup = (result as Result.Success).payload
            assertThat(actualBackup).isEqualToComparingFieldByFieldRecursively(backup)
        }
    }

    @Test
    fun `export and import fails with wrong password`() {
        coEvery { identifierService.getMasterIdentifier() } returns Result.Success(masterIdentifier)
        runBlocking {
            val protectionMethod = JwePasswordProtectionMethod(password)
            val protectionMethod2 = JwePasswordProtectionMethod("wrong password")
            val protectedBackupData = (service.exportBackup(backup, protectionMethod) as Result.Success).payload
            assertThat(protectedBackupData).isInstanceOf(JwePasswordProtectedBackupData::class.java)

            val exception = (service.importBackup(protectedBackupData, protectionMethod2) as Result.Failure).payload
            assertThat(exception).isInstanceOf(FailedDecryptException::class.java)
        }
    }

    @Test
    fun `parse Microsoft PBE encrypted backup returns backup`() {
        runBlocking {
            assertThat(service.parseBackup(testBackupString + testBackupString2 + testBackupString3)).isInstanceOf(Result.Success::class.java)
        }
    }

    @Test
    fun `parse backup returns Failure for bad String`() {
        runBlocking {
            assertThat(service.parseBackup("ASDF")).isInstanceOf(Result.Failure::class.java)
        }
    }
}
